import React, { useEffect, useState } from 'react';
function App() {
  const [users, setUsers] = useState([]);
  useEffect(()=>{
    fetch('data.json')
    .then(res=>res.json())
    .then(data=>setUsers(data));
  },[]);
  return (
    <div className="App">
      {
        users.m
      }
    </div>
  );
}

export default App;
